import React from 'react';
import './selectWorkout.scss'
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Select from '@material-ui/core/Select';




function SelectWorkout(props) {
    console.log(props.workoutName)

    // const handleChange = (event) => {
    //     const workoutName = event.target.name;
    //     this.setState({
    //       [workoutName]: event.target.value,
    //     });
    //   };

    return (
        <div className="selectWorkout">
            <div className="selectWorkout__header">
                {/* <h2 className="selectWorkout__header-title">Workout Name</h2> */}
                <FormControl variant="filled" className= "select">
                    <InputLabel>Workout Name</InputLabel>
                    <Select
                        native
                        // value={state.age}
                        // onChange={handleChange}
                        inputProps={{
                            name: 'Workout Name',
                            id: 'filled-age-native-simple',
                        }}
                    >
                        <option aria-label="None" value="" />
                        <option value={10}>Ten</option>
                        <option value={20}>Twenty</option>
                        <option value={30}>Thirty</option>
                    </Select>
                </FormControl>
            </div>
            <div>

            </div>
        </div>
    );
}

export default SelectWorkout;
